import './App.css';
import Images from './Images';
import profile from './files/Profile.PNG'
function App() {
  return (
    <div className="Wrapper">
      <div>
      <div className="GeneralInfo">
      <img src={profile} alt="" style={{"height" : "50%", "width" : "50%", "border-radius": "25%"}}></img>
        <p> Abhinandan Srinivas </p>
        <p> Software Developer </p>
        <button> Resume </button>
        <a href=""> GitHub </a>
      </div>
      <div className="Frameworks">
        <p>Frameworks I can work with</p>
        <Images />
      </div>
    </div>
      <div>
        <p> Some of my projects </p>
      </div>
    </div>
  );
}

export default App;
